insert into `catalog_product_attribute_text` (`value_id`,`product_id`,`attribute_id`,`store_id`,`attribute_value`,`parent_id`,`is_inherit`) values (5426,2333,2,1,'Birkenstock\'s classic slip-on clog. The upper has an adjustable instep strap for a more secure fit. The cork/latex footbed will break-in over time and form to your footprint.',0,1),(5427,2334,2,1,'The classic Boston Clog in soft taupe suede.  Has an adjustable vamp strap and shock-absorbing EVA outer sole.  Features Birkenstock\'s special suede-lined cork/latex Soft Footbed for ultimate comfort.  Comes in sizes 36-46 in both Regular and Narrow widths.',0,1),(5428,2335,2,1,'Back-strap sandal in a variety of materials with fully adjustable straps and shock-absorbing EVA sole. Features Birkenstock\'s classic suede-lined cork/latex footbed.',0,1);
insert into `catalog_product_attribute_text` (`value_id`,`product_id`,`attribute_id`,`store_id`,`attribute_value`,`parent_id`,`is_inherit`) values (5429,2336,2,1,'Find out what everyone is raving about. No smoke, no mirrors, and no gizmos are needed. The comfort and support of these classic Birkenstock sandals are unparalleled. In smooth brown leather, the Milano features Birkenstock\'s super comfy contoured suede-lined cork footbed, adjustable leather back and vamp straps, and a shock-absorbing EVA outsole.  Step into bliss!',0,1),(5430,2337,2,1,'Find out what everyone is raving about. No smoke, no mirrors, and no gizmos are needed. The comfort and support of these classic Birkenstock sandals are unparalleled. In soft nubuck leather, the Milano features Birkenstock\'s super comfy contoured suede-lined cork footbed, adjustable leather back and vamp straps, and a shock-absorbing EVA outsole.  Step into bliss!',0,1),(5431,2338,2,1,'The classic two-strap style you know and love in carefree Birko-Flor.  Has two  fully adjustable straps and shock-absorbing EVA sole.',0,1),(5432,2339,2,1,'The classic two-strap style you know and love in carefree Birko-Flor.  Has two  fully adjustable straps and shock-absorbing EVA sole.',0,1),(5433,2340,2,1,'Classic two-strap sandal you know and love in a soft cocoa nubuck leather with fully adjustable straps and shock-absorbing EVA sole.',0,1);
insert into `catalog_product_attribute_text` (`value_id`,`product_id`,`attribute_id`,`store_id`,`attribute_value`,`parent_id`,`is_inherit`) values (5434,2341,2,1,'Classic two-strap style in a variety of materials with fully adjustable straps and shock-absorbing EVA sole. Some colors and materials available with a soft footbed, a high arch or in kids\' sizes.',0,1),(5435,2342,2,1,'Classic two-strap style in luscious bordeaux soft gloss leather.  Has fully adjustable straps and shock-absorbing EVA sole.',0,1),(5436,2343,2,1,'Classic two-strap sandal you know and love in white leather.  Has fully adjustable straps and shock-absorbing EVA sole.',0,1),(5437,2344,2,1,'The classic two-strap sandal style you know and love in oiled leather.  Compared to smooth leather, oiled leather has a softer feel and is a bit less shiny.  Has two fully adjustable straps and shock-absorbing EVA sole.',0,1),(5438,2345,2,1,'Classic two-strap style in a variety of materials with fully adjustable straps and shock-absorbing EVA sole. Some colors and materials available with a soft footbed, a high arch or in kids\' sizes.',0,1),(5439,2346,2,1,'Classic two-strap sandal in soft black suede with fully adjustable straps and shock-absorbing EVA sole. Also available with a soft footbed.',0,1);
