insert into `catalog_product_attribute_text` (`value_id`,`product_id`,`attribute_id`,`store_id`,`attribute_value`,`parent_id`,`is_inherit`) values (6207,2447,2,2,'A popular style that provides long term comfort and arch support to any heeled footwear (up to 1\" heels). Contoured arches and deep heel cup can help relieve heel pain and plantar fasciitis symptoms. Similar to the Casual Blue Footbed, this heeled version has silk lining that absorbs moisture and is hand-washable. Heeled Blue Footbed is available in narrow, medium and wide widths. \r\nHeeled - For heeled footwear up to 1\".',0,1),(6208,2448,2,2,'Arch support with natural cork and EVA. It features a deep molded heel cup, pronounced medial arch support and moderate metatarsal support.\r\n\r\nSupports the medial arch - Can help with problems such as fallen arches and over-pronation.\r\nSupports the ball of the foot - Helps maintain the natural curvature necessary for optimal weight-bearing and transfer.\r\nProvides proper alignment - Balances foot impact areas. Can reduce fatigue and increase life of footwear. \r\nHigh Flanges - Increases stability. Helps control excessive pronation and/or supination.\r\nDeep Heel Cup - Cushions and protects the heel bone. Can relieve heel pain symptoms. Provides natural cushioning and shock absorption.',0,1);
