insert into `catalog_product_attribute_text` (`value_id`,`product_id`,`attribute_id`,`store_id`,`attribute_value`,`parent_id`,`is_inherit`) values (6343,2583,2,2,'A sporty take on the classic Mary Jane style.  A velcro strap provides easy on/off for a chic yet casual shoe with soft suede uppers and removeable cork footbeds.  Rubber soles provide traction. The removable cork footbed is slightly trimmer than the Classic footbed, so women with wide feet may wear one size larger.',0,1),(6344,2584,2,2,'A cross-strap, toe loop sandal with an adjustable strap in silky suede with a shock absorbing EVA sole. Available in narrow and regular widths.',0,1),(6345,2585,2,2,'An adjustable two-strap sandal in a soft nubuck finish with shock-absorbing EVA sole.',0,1),(6346,2586,2,2,'Simple, sleek loafer with a silver buckle and moc stitching. This ladies\' slip-on shoe is made for comfort on the go. Includes a removable contoured footbed.',0,1),(6347,2587,2,2,'The shoe that looks like a boot, but feels like a sneaker. Padded heel and tongue ensure a snug fit.  Includes removable cork/latex footbed and shock-absorbing polyurethane/rubber sole with dense rubber tread for traction.',0,1),(6348,2588,2,2,'The shoe that looks like a high-top boot, but feels like a sneaker. Padding on both the heel and the tongue ensure a snug fit, while the dense rubber tread helps to provide traction.  Removeable contoured cork/leather footbed keeps your feet feeling good.',0,1);
insert into `catalog_product_attribute_text` (`value_id`,`product_id`,`attribute_id`,`store_id`,`attribute_value`,`parent_id`,`is_inherit`) values (6349,2589,2,2,'A sporty, sneaker like shoe in Sage suede, fully leather lined, removable cork/latex molded footbed, hand stitched polyurethane/rubber sole.',0,1),(6350,2590,2,2,'With a soft top, smooth toe seam and personalized fit, this crew-high sock is so comfortable you won’t want to take it off. And since it’s odor-free, you won’t even have to.  Shrink free, machine wash and dry, no fabric softener necessary.  70% wool, 8% Nylon, 2% Spandex - Crew Height - Womens sizes US 7-9 1/2 Euro 38-41',0,1),(6351,2591,2,2,'With a soft top, smooth toe seam and personalized fit, this crew-high sock is so comfortable you won’t want to take it off. And since it’s odor-free, you won’t even have to.  Shrink free, machine wash and dry, no fabric softener necessary.  70% wool, 8% Nylon, 2% Spandex - Crew Height - Womens sizes US 7-9 1/2 Euro 38-41',0,1);
